import React from "react";
import { carouselItems } from "../../carouselDB";

export const Carousel = () => {
  return (
    <>
      {carouselItems?.map(({ id, name, image }) => (
        <div
          className="carousel"
          key={id}
          style={{
            width: "100vw",
            height: "100vh",
            display: "flex",
          }}
        >
          <figure>
            <img
              src={"https://i.ibb.co/ryyXpSr/slider-pendant-lighting.jpg"}
              alt=""
              style={{ width: "100vw" }}
            />
          </figure>
        </div>
      ))}
    </>
  );
};
